$templateCache.put(templateBaseURI + '/helps/helps-help.html',' <div id="page_rightcontent">\r\n   <h2 class="align-c" style="margin:1.8rem">\u4EC0\u4E48\u662F\u5E78\u8FD028\uFF1F</h2>\r\n   <p>\r\n     \u5E78\u8FD028\u662F\u4E00\u79CD\u7B80\u5355\u6709\u8DA3\u7684\u6570\u5B57\u7ADE\u731C\u6E38\u620F\uFF0C\u603B\u5171\u670928\u4E2A\u6570\u5B57\uFF0C\u4ECE0\u4F9D\u6B21\u523027\u3002\u8FD9\u4E2A\u6570\u5B57\u662F\u7531\u4E09\u4E2A\u5355\u72EC\u7684\u4E2A\u4F4D\u6570\u5B57\uFF080-9\uFF09\u76F8\u52A0\u800C\u5F97\u5230\u7684\uFF0C\u5F00\u5956\u65F6\u7CFB\u7EDF\u4EA7\u751F\u4E09\u4E2A\u6570\u5B57\uFF0C\u76F8\u52A0\u540E\u5F97\u51FA\u7684\u6570\u5B57\u5373\u4E3A\u5F00\u5956\u7ED3\u679C\uFF0C\u60A8\u82E5\u62BC\u4E2D\u4E86\u8FD9\u4E2A\u6570\u5B57\uFF0C\u5373\u53EF\u5F97\u5230\u76F8\u5E94\u7684\u5956\u52B1\u3002\r\n   </p>\r\n   <p>\r\n     \u56E0\u4E3A\u6BCF\u4E2A\u6570\u5B57\u51FA\u73B0\u7684\u6982\u7387\u5E76\u4E0D\u4E00\u6837\uFF0C\u5982\u51FA\u73B00\u7684\u53EF\u80FD\u53EA\u67091\u4E2A\uFF0C\u5C31\u662F0+0+0\uFF0C\u51FA\u73B03\u4E2A\u53EF\u80FD\u5C31\u670910\u79CD\uFF0C\u59820+3+0\uFF0C1+1+2\u7B49\u7B49\uFF1B\u8FD9\u6837\u8D8A\u662F\u4E2D\u95F4\u7684\u6570\u5B57\u5176\u7EC4\u5408\u5F62\u5F0F\u8D8A\u591A\uFF0C\u51FA\u73B0\u7684\u6982\u7387\u4E5F\u5C31\u8D8A\u5927\uFF0C\u6BD4\u5982\u51FA\u73B013\u621614\u7684\u53EF\u80FD\u7EC4\u5408\u5C31\u670975\u4E2A\u3002\u6240\u4EE5\uFF0C\u4E2D\u5956\u6570\u5B57\u7684\u966A\u7387\u6839\u636E\u7EC4\u5408\u7684\u591A\u5C11\u4E5F\u6709\u5DEE\u5F02\uFF0C\u4E2D\u5956\u6982\u7387\u9AD8\u7684\u6570\u5B57\u966A\u7387\u4E5F\u4F4E\uFF1B\r\n   </p>\r\n   <p class="marg">\r\n     \u6B64\u6E38\u620F\u89C4\u5219\u7B80\u5355\uFF0C\u5374\u53D8\u5316\u65E0\u7A77\u3002\u5165\u95E8\u5BB9\u6613\uFF0C\u4F46\u7CBE\u901A\u4E0D\u6613\u3002\u4E0B\u5355\u53EF\u5927\u53EF\u5C0F\uFF0C\u8D54\u7387\u4E5F\u53EF\u5927\u53EF\u5C0F\u3002\u51E0\u5206\u949F\u4E00\u671F\u7684\u5F00\u5956\u9891\u7387\uFF0C\u53EF\u8BA9\u7231\u597D\u8005\u6574\u65E5\u6E38\u620F\uFF0C\u4E50\u6B64\u4E0D\u75B2\u3002\r\n   </p>\r\n   <h2 class="align-c">\u5728\u8D35\u5E73\u53F0\u8FDB\u884C\u6E38\u620F\u662F\u5426\u5B89\u5168\uFF1F</h2>\r\n   <p class="marg">\r\n     \u60A8\u597D\uFF0C\u672C\u5E73\u53F0\u7CFB\u7EDF\u7EDD\u5BF9\u5B89\u5168\u3002\u6211\u4EEC\u51B3\u4E0D\u6CC4\u6F0F\u5BA2\u6237\u7684\u4E2A\u4EBA\u8D44\u6599\u7ED9\u4EFB\u4F55\u5546\u4E1A\u673A\u6784\u3002\u6B64\u5916\uFF0C\u6211\u4EEC\u4EA6\u8981\u6C42\u6709\u4EA4\u6613\u5F80\u6765\u7684\u94F6\u884C\uFF0C\u4FE1\u7528\u5361\u4E2D\u8F6C\u4EE3\u7406\u7B49\u4E25\u683C\u4FDD\u5BC6\u5BA2\u6237\u7684\u8D44\u6599\u3002\u6240\u6709\u7684\u5B58\u6B3E\u5C06\u89C6\u4E3A\u8D38\u6613\u6237\u53E3\uFF0C\u5E76\u4E0D\u4F1A\u4EA4\u7ED9\u5176\u5B83\u7684\u4EBA\u58EB\u8FDB\u884C\u3002\r\n   </p>\r\n   <h2 class="align-c">\u5F00\u6237\u8D44\u6599\u662F\u5426\u8981\u586B\u5199\u771F\u5B9E\u59D3\u540D\uFF1F</h2>\r\n   <p class="marg">\r\n     \u60A8\u597D\uFF0C\u57FA\u4E8E\u5B89\u5168\u7406\u7531\uFF0C\u63D0\u6B3E\u65F6\u8D22\u52A1\u90E8\u4F1A\u6309\u7167\u6CE8\u518C\u59D3\u540D\u8FDB\u884C\u5BA1\u6838\uFF0C\u94F6\u884C\u5361\u6237\u540D\u5FC5\u987B\u4E0E\u6CE8\u518C\u59D3\u540D\u76F8\u540C\u65B9\u53EF\u63D0\u6B3E\uFF0C\u6240\u4EE5\u8BF7\u60A8\u5728\u5F00\u6237\u65F6\u586B\u5199\u7684\u59D3\u540D\u5FC5\u987B\u4E0E\u60A8\u63D0\u6B3E\u7684\u6237\u540D\u76F8\u540C\u3002\r\n   </p>\r\n   <h2 class="align-c">\u5FD8\u8BB0\u5BC6\u7801\u600E\u4E48\u529E\uFF1F</h2>\r\n   <p class="marg">\u60A8\u597D\uFF0C\u8BF7\u53CA\u65F6\u8054\u7CFB24\u5C0F\u65F6\u5BA2\u670D\u6216\u8005QQ\u5BA2\u670D\u67E5\u8BE2\u6216\u4FEE\u6539 \u63D0\u4F9B\u6CE8\u518C\u6D88\u606F\uFF1A\u6BD4\u5982QQ\u53F7\u7801\uFF0C\u624B\u673A\u53F7\u7801\uFF0C\u7B49\u8D44\u6599\u786E\u8BA4\u662F\u672C\u4EBA\u3002\u8C22\u8C22\uFF01</p>\r\n   <h2 class="align-c">\u5E73\u53F0\u6709\u54EA\u4E9B\u6E38\u620F?</h2>\r\n   <p class="marg">\u60A8\u597D\uFF0CAG\u86CB\u86CB\u5E73\u53F0\u76EE\u524D\u4E3A\u60A8\u63D0\u4F9B\u201C\u5E78\u8FD028+\u52A0\u62FF\u592728\u201D\u5168\u592924\u5C0F\u65F6\u5728\u7EBF,\u5168\u65B0\u65F6\u65F6\u5F69\u4E5F\u4E0A\u7EBF\u5728\u5373\u3002</p>\r\n   <h2 class="align-c">\u8BE5\u5982\u4F55\u4E3A\u6211\u7684\u6E38\u620F\u8D26\u53F7\u5145\u503C?</h2>\r\n   <p class="marg">\r\n     \u60A8\u597D\uFF0C\u5148\u767B\u5F55\u5230\u5E73\u53F0\uFF0C\u53EF\u4EE5\u5148\u8FDB\u5165\u4F1A\u5458\u4E2D\u5FC3\uFF0C\u5728\u4F1A\u5458\u4E2D\u5FC3\u83DC\u5355\u4E2D\u9009\u62E9 \u201C\u8D44\u91D1\u201D-&gt;\u201C\u5145\u503C\u201D\uFF0C\u6216\u8005\u767B\u9646\u540E\u5728\u9875\u9762\u53F3\u4E0A\u65B9\u9009\u62E9\u201C\u5145\u503C\u201D\uFF0C\u7136\u540E\u6839\u636E\u63D0\u793A\u53CA\u4E2A\u4EBA\u60C5\u51B5\u5B8C\u6210\u5145\u503C\u64CD\u4F5C\uFF0C\u5B8C\u6210\u540E\u7CFB\u7EDF\u5C06\u4F1A\u81EA\u52A8\u5BF9\u8D26\u6237\u8FDB\u884C\u5145\u503C\r\n   </p>\r\n   <h2 class="align-c">\u5982\u4F55\u8BC1\u660E\u6E38\u620F\u7ED3\u679C\u662F\u5B9E\u65F6\u7684\uFF1F</h2>\r\n   <p class="marg">\r\n     \u60A8\u597D\uFF0C\u5168\u56FD\u5F00\u5956\u7EDF\u4E00\uFF0C\u7B2C\u4E09\u65B9\u5B98\u65B9\u5F00\u5956\uFF0C\u5F00\u5956\u5168\u7A0B\u900F\u660E\uFF0C\u4FDD\u8BC1\u516C\u5E73\u516C\u6B63\u3002\u6211\u4EEC\u786E\u4FDD\u6240\u6709\u6E38\u620F\u7ED3\u679C\u5747\u4E3A\u771F\u5B9E\u7684\u5B9E\u65F6\u7ED3\u679C\uFF0C\u60A8\u4E5F\u53EF\u4EE5\u5728\u9A8C\u8BC1\u9875\u9762\u9A8C\u8BC1\u6211\u4EEC\u7684\u5F00\u5956\u7ED3\u679C\u3002\r\n   </p>\r\n   <h2 class="align-c">\u4E3A\u4EC0\u4E48\u7CFB\u7EDF\u4F1A\u5C06\u6211\u767B\u51FA\uFF1F</h2>\r\n   <p class="marg">\r\n     \u60A8\u597D\uFF0C\u8FD9\u662F\u7F51\u9875\u7684\u4FDD\u5B89\u7A0B\u5F0F\u4E4B\u4E00\uFF0C\u5F53\u60A8\u5728\u4E00\u5B9A\u7684\u65F6\u95F4\u5185\u6CA1\u6709\u4F7F\u7528\u6709\u5173\u7684\u7F51\u9875\uFF0C\u90A3\u4E48\u6709\u5173\u7684\u7F51\u9875\u5C06\u4E0D\u518D\u6D3B\u8DC3\uFF0C\u5E76\u4E14\u65E0\u6CD5\u6D4F\u89C8\u6700\u65B0\u7684\u9875\u9762\uFF0C\u5728\u6B64\u60A8\u5FC5\u9700\u91CD\u65B0\u767B\u5165\uFF1B\u82E5\u60A8\u91CD\u65B0\u767B\u5165\u540E\u60C5\u51B5\u4ECD\u7136\u4E00\u6837\u8BF7\u7ACB\u5373\u8054\u7CFB\u6211\u4EEC\u3002\r\n   </p>\r\n   <h2 class="align-c">AG\u86CB\u86CB\u5E73\u53F0\u5B9E\u529B\u600E\u6837\uFF1F</h2>\r\n   <p class="marg">\u60A8\u53EF\u4EE5\u53C2\u8003\u5173\u4E8E\u6211\u4EEC\u7684\u4ECB\u7ECD.</p>\r\n </div>');
$templateCache.put(templateBaseURI + '/helps/helps-notice.html','\r\n<div id="page_rightcontent">\r\n  <div class="tabwrap">\r\n    <div class="tabtype">\r\n      <a  href="javascript:void(0);" class="tabbtn" ng-class="{current:noticeFlag}" ng-click="noticeFlag=true">AG \u516C\u544A</a>\r\n      <a  href="javascript:void(0);" class="tabbtn" ng-class="{current:!noticeFlag}" ng-click="noticeFlag=false">AG \u6D3B\u52A8</a>\r\n    </div>\r\n  </div>\r\n  <ng-include src="templateURI(\'/helps/notice1.html\')" ng-show="noticeFlag"></ng-include>\r\n  <ng-include src="templateURI(\'/helps/notice2.html\')" ng-show="!noticeFlag"></ng-include>\r\n </div>\r\n</div>');
$templateCache.put(templateBaseURI + '/helps/helps-provision.html','<div id="page_rightcontent">\r\n  <p style="text-indent:0;"> <b>\u4E00\u3001\u5E10\u53F7\u7BA1\u7406\u89C4\u5219</b>\r\n    <br>\r\n    1. \u5FC5\u987B\u4F7F\u7528\u771F\u5B9E\u8EAB\u4EFD\u4FE1\u606F\u6CE8\u518C\u8D26\u53F7\uFF0C\u6635\u79F0\u548C\u7528\u6237\u8D44\u6599\u7B49\u81EA\u5B9A\u4E49\u547D\u540D\u5747\u4E0D\u5F97\u4F7F\u7528\u8FDD\u53CD\u56FD\u5BB6\u6CD5\u89C4\u6216\u5E26\u4FAE\u8FB1\u6027\u7684\u8BCD\u8BED\uFF1B\r\n    <br>\r\n    2. \u6240\u6709\u6CE8\u518C\u8D26\u53F7\u53EA\u53EF\u7528\u4E8E\u6B63\u5E38\u767B\u9646AG\u86CB\u86CB\uFF0C\u8FDB\u884C\u6E38\u620F\uFF0C\u4E0D\u5F97\u7528\u4E8E\u5BF9AG\u86CB\u86CB\u8FDB\u884C\u6076\u610F\u653B\u51FB\u6216\u7834\u574F\uFF1B\r\n    <br>\r\n    3. AG\u86CB\u86CB\u5B98\u65B9\u6709\u6743\u5BF9\u4EFB\u4F55\u4E0D\u7B26\u5408\u8D26\u53F7\u7BA1\u7406\u89C4\u5219\u7684\u8D26\u53F7\u8FDB\u884C\u51BB\u7ED3\u548C\u5904\u7F5A\u3002\r\n    <br> <b>\u4E8C\u3001\u7F51\u7AD9BUG\u89C4\u5219</b>\r\n    <br>\r\n    1. AG\u86CB\u86CB\u9F13\u52B1\u8C46\u53CB\u62A5\u544A\u7F51\u7AD9\u4F53\u9A8C\u4E2D\u51FA\u73B0\u7684\u95EE\u9898\u548Cbug\uFF0C\u4E00\u7ECF\u8BC1\u5B9E\u5C06\u6709\u673A\u4F1A\u83B7\u5F97\u5B98\u65B9\u5956\u52B1\uFF1B\r\n    <br>\r\n    2. \u6240\u6709\u5229\u7528AG\u86CB\u86CB\u7F51\u7AD9\u5E73\u53F0\u4E0A\u7684\u6F0F\u6D1E\u8FDB\u884C\u975E\u6CD5\u8C0B\u5229\u6216\u6076\u610F\u653B\u51FB\u7684\u884C\u4E3A\u88AB\u4E25\u683C\u7981\u6B62\uFF0C\u4E00\u7ECF\u53D1\u73B0\uFF0C\u8D26\u53F7\u5C06\u88AB\u51BB\u7ED3\uFF0C\u6C38\u4E0D\u89E3\u51BB\uFF1B\r\n    <br>\r\n    3. \u5BF9\u4E8E\u53EF\u80FD\u5BFC\u81F4\u4E25\u91CD\u5F71\u54CD\u7F51\u7AD9\u8FD0\u8425\u5E73\u8861\u7684\u91CD\u5927\u95EE\u9898\uFF0CAG\u86CB\u86CB\u6709\u6743\u8FDB\u884C\u4FEE\u6B63\u3001\u64A4\u9500\u6216\u505C\u6B62\u670D\u52A1\u5668\u8FD0\u884C\uFF1B\r\n    <br>\r\n    <b>\u4E09\u3001\u4E25\u7981\u975E\u5B98\u65B9\u8F85\u52A9\u5DE5\u5177\u89C4\u5219</b>\r\n    <br>\r\n    1. AG\u86CB\u86CB\u7981\u6B62\u4F7F\u7528\u4EFB\u4F55\u975E\u5B98\u65B9\u63D0\u4F9B\u7684\u8F85\u52A9\u5DE5\u5177\uFF0C\u5982\u6709\u53D1\u73B0\u76F4\u63A5\u5C01\u53F7\u5904\u7406,\u7531\u6B64\u5E26\u6765\u7684\u4EFB\u4F55\u540E\u679C\u7531\u7528\u6237\u81EA\u5DF1\u8D1F\u8D23\uFF1B\r\n    <br>\r\n    2. AG\u86CB\u86CB\u5B98\u65B9\u4FDD\u7559\u5BF9\u4F7F\u7528\u8F85\u52A9\u5DE5\u5177\u767B\u9646\u548C\u4F7F\u7528AG\u86CB\u86CB\u4EA7\u54C1\u548C\u670D\u52A1\u7684\u8D26\u53F7\u7684\u5904\u7F6E\u6743\u3002\r\n    <br>\r\n    <b>\u56DB\u3001\u5904\u7F5A\u89C4\u5219</b>\r\n    <br>\r\n    1. \u7528\u6237\u88AB\u8B66\u544A\u7D2F\u8BA12\u6B21\u4EE5\u4E0A\uFF0C\u6B64\u540E\u8FDD\u89C4\u4E00\u5F8B\u51BB\u7ED3\u8D26\u53F7\uFF1B\r\n    <br>\r\n    2. \u6709\u51BB\u7ED3\u8BB0\u5F55\u7684\u7528\u6237\uFF0C\u4E00\u65E6\u8FDD\u89C4\uFF0C\u4E00\u5F8B\u51BB\u7ED3\u8D26\u53F7\uFF1B\r\n    <br>\r\n    3. \u5BF9\u591A\u6B21\u8FDD\u89C4\u3001\u5C61\u7981\u4E0D\u6B62\u6216\u8005\u91C7\u53D6\u5176\u4ED6\u8FC7\u6FC0\u884C\u4E3A\u7684\u7528\u6237\uFF0C\u5C06\u6C38\u4E0D\u89E3\u51BB\u3002\r\n    <br>\r\n    \u5904\u7F5A\u65B9\u5F0F\u5982\u4E0B\uFF1A\r\n    <br>\r\n    1) \u8B66\u544A\uFF1A\u5373\u5BF9\u7528\u6237\u8FDB\u884C\u8B66\u544A\u3002\r\n    <br>\r\n    2) \u7981\u8A00\uFF1A\u5373\u7981\u6B62\u8FDD\u89C4\u7528\u6237\u53D1\u8A00\u7684\u6743\u5229\uFF1B\r\n    <br>\r\n    3) \u91D1\u5E01\u6263\u9664\uFF1A\u6839\u636E\u7528\u6237\u8FDD\u89C4\u884C\u4E3A\u7684\u4E25\u91CD\u7A0B\u5EA6\uFF0C\u8FDD\u89C4\u540E\u7684\u8BA4\u9519\u6001\u5EA6\u548C\u914D\u5408\u6001\u5EA6\u6765\u8003\u91CF\uFF0C\u6263\u9664\u8FDD\u89C4\u7528\u6237\u8D26\u53F7\u4E0A\u7684\u91D1\u5E01\u4F5C\u4E3A\u5904\u7F5A\uFF1B\r\n    <br>\r\n    4) \u91D1\u5E01\u6E05\u96F6\uFF1A\u6E05\u96F6\u8FDD\u89C4\u7528\u6237\u8D26\u53F7\u4E0A\u7684\u91D1\u5E01\uFF1B\r\n    <br>\r\n    5) \u51BB\u7ED3\u8D26\u53F7\uFF1A\u5373\u51BB\u7ED3\u8FDD\u89C4\u7528\u6237\u7684\u8D26\u53F7\uFF1B\r\n    <br>\r\n    6) \u7528\u6237\u5BF9\u60E9\u7F5A\u5982\u6709\u89E3\u91CA\u6216\u610F\u89C1\uFF0C\u7BA1\u7406\u5458\u6709\u6743\u6839\u636E\u5B9E\u9645\u60C5\u51B5\u51B3\u5B9A\u662F\u5426\u66F4\u6539\u5904\u7F5A\u5E76\u56DE\u590D\u7ED3\u679C\r\n    <br>\r\n    <b>\u4E94\u3001\u7528\u6237\u884C\u4E3A\u51C6\u5219</b>\r\n    <br>\r\n    1.\u540C\u610F\u5E76\u6309\u7167AG\u86CB\u86CB\u5B98\u65B9\u4E0D\u65F6\u53D1\u5E03\u3001\u53D8\u66F4\u548C\u4FEE\u6539\u7684\u6B64\u7528\u6237\u89C4\u5219\u53CA\u5176\u4ED6\u89C4\u5219\uFF0C\u63A5\u53D7\u5E76\u4F7F\u7528\u6211\u4EEC\u7684\u4EA7\u54C1\u548C\u670D\u52A1\uFF0C\u4E0D\u5F97\u901A\u8FC7\u4E0D\u6B63\u5F53\u7684\u624B\u6BB5\u6216\u5176\u4ED6\u4E0D\u516C\u5E73\u7684\u624B\u6BB5\u4F7F\u7528\u6211\u4EEC\u7684\u4EA7\u54C1\u548C\u670D\u52A1\u3002\r\n    <br>\r\n    2. \u7528\u6237\u4E0D\u5F97\u5E72\u6270\u5B98\u65B9\u6B63\u5E38\u5730\u63D0\u4F9B\u4EA7\u54C1\u548C\u670D\u52A1\uFF0C\u5305\u62EC\u4F46\u4E0D\u9650\u4E8E\uFF1A\r\n    <br>\r\n    1) \u653B\u51FB\u3001\u4FB5\u5165\u5B98\u65B9\u7F51\u7AD9\u3001\u5E7F\u544A\u3001\u6E38\u620F\u3001\u8BBA\u575B\u670D\u52A1\u5668\u6216\u4F7F\u670D\u52A1\u5668\u8FC7\u8F7D\uFF1B\r\n    <br>\r\n    2) \u7834\u89E3\u3001\u4FEE\u6539\u5B98\u65B9\u63D0\u4F9B\u7684\u4EFB\u4F55\u7A0B\u5E8F\uFF1B\r\n    <br>\r\n    3) \u5236\u4F5C\u3001\u53D1\u5E03\u3001\u4F20\u64AD\u548C\u4F7F\u7528\u4EFB\u4F55\u5F62\u5F0F\u7684\u59A8\u788D\u6E38\u620F\u516C\u5E73\u6027\u7684\u8F85\u52A9\u5DE5\u5177\u6216\u7A0B\u5E8F\uFF08\u5916\u6302\uFF09\uFF1B\r\n    <br>\r\n    4) \u5229\u7528\u7A0B\u5E8F\u7684\u6F0F\u6D1E\u548C\u9519\u8BEF\uFF08Bug\uFF09\u7834\u574F\u7F51\u7AD9\u7684\u6B63\u5E38\u8FD0\u8425\u6216\u4F20\u64AD\u8BE5\u6F0F\u6D1E\u6216\u9519\u8BEF\uFF08Bug\uFF09\uFF1B\r\n    <br>\r\n    5) \u5E72\u6270\u6216\u963B\u788D\u4ED6\u4EBA\u4F7F\u7528\u6211\u4EEC\u6240\u63D0\u4F9B\u7684\u4EA7\u54C1\u548C\u670D\u52A1\u3002\r\n    <br>\r\n    3. \u7528\u6237\u5FC5\u987B\u4FDD\u7BA1\u597D\u81EA\u5DF1\u7684\u8D26\u53F7\u548C\u5BC6\u7801\uFF0C\u7531\u4E8E\u7528\u6237\u4E2A\u4EBA\u7684\u539F\u56E0\u5BFC\u81F4\u8D26\u53F7\u548C\u5BC6\u7801\u6CC4\u5BC6\u800C\u9020\u6210\u7684\u540E\u679C\u5747\u5C06\u7531\u8BE5\u7528\u6237\u81EA\u884C\u627F\u62C5\u3002\r\n    <br>\r\n    4. \u7528\u6237\u4EC5\u80FD\u4EE5\u4E00\u4E2A\u5355\u72EC\u7684\u4E2A\u4EBA\u7684\u8EAB\u4EFD\u4F7F\u7528\u5B98\u65B9\u6240\u63D0\u4F9B\u7684\u4EA7\u54C1\u548C\u670D\u52A1\uFF0C\u4E0D\u80FD\u5229\u7528\u5B98\u65B9\u6240\u63D0\u4F9B\u7684\u4EA7\u54C1\u548C\u670D\u52A1\u8FDB\u884C\u9500\u552E\u6216\u5176\u4ED6\u5546\u4E1A\u76EE\u7684\u7684\u6D3B\u52A8\u3002\r\n    <br>\r\n    5. \u7528\u6237\u9700\u5BF9\u81EA\u5DF1\u8D26\u53F7\u4E2D\u7684\u6240\u6709\u6D3B\u52A8\u548C\u4E8B\u4EF6\u8D1F\u8D23\u3002\u987B\u9075\u5B88\u6709\u5173\u4E92\u8054\u7F51\u4FE1\u606F\u53D1\u5E03\u7684\u6709\u5173\u6CD5\u5F8B\u3001\u6CD5\u89C4\u53CA\u901A\u5E38\u9002\u7528\u7684\u4E92\u8054\u7F51\u4E00\u822C\u9053\u5FB7\u548C\u793C\u4EEA\u7684\u89C4\u8303\uFF0C\u7528\u6237\u5C06\u81EA\u884C\u627F\u62C5\u5176\u6240\u53D1\u5E03\u7684\u4FE1\u606F\u5185\u5BB9\u7684\u8D23\u4EFB\u3002 \u7279\u522B\u7684\uFF0C\u7528\u6237\u4E0D\u5F97\u53D1\u5E03\u4E0B\u5217\u5185\u5BB9\uFF1A\r\n    <br>\r\n    1) \u53CD\u5BF9\u5BAA\u6CD5\u6240\u786E\u5B9A\u7684\u57FA\u672C\u539F\u5219\u7684\uFF1B\r\n    <br>\r\n    2) \u5371\u5BB3\u56FD\u5BB6\u5B89\u5168\uFF0C\u6CC4\u9732\u56FD\u5BB6\u79D8\u5BC6\uFF0C\u98A0\u8986\u56FD\u5BB6\u653F\u6743\uFF0C\u7834\u574F\u56FD\u5BB6\u7EDF\u4E00\u7684\uFF1B\r\n    <br>\r\n    3) \u635F\u5BB3\u56FD\u5BB6\u8363\u8A89\u548C\u5229\u76CA\u7684\uFF1B\r\n    <br>\r\n    4) \u717D\u52A8\u6C11\u65CF\u4EC7\u6068\u3001\u6C11\u65CF\u6B67\u89C6\uFF0C\u7834\u574F\u6C11\u65CF\u56E2\u7ED3\u7684\uFF1B\r\n    <br>\r\n    5) \u7834\u574F\u56FD\u5BB6\u5B97\u6559\u653F\u7B56\uFF0C\u5BA3\u626C\u90AA\u6559\u548C\u5C01\u5EFA\u8FF7\u4FE1\u7684\uFF1B\r\n    <br>\r\n    6) \u6563\u5E03\u8C23\u8A00\uFF0C\u6270\u4E71\u793E\u4F1A\u79E9\u5E8F\uFF0C\u7834\u574F\u793E\u4F1A\u7A33\u5B9A\u7684\uFF1B\r\n    <br>\r\n    7) \u6563\u5E03\u6DEB\u79FD\u3001\u8272\u60C5\u3001\u8D4C\u535A\u3001\u66B4\u529B\u3001\u51F6\u6740\u3001\u6050\u6016\u6216\u8005\u6559\u5506\u72AF\u7F6A\u7684\uFF1B\r\n    <br>\r\n    8) \u4FAE\u8FB1\u6216\u8005\u8BFD\u8C24\u4ED6\u4EBA\uFF0C\u4FB5\u5BB3\u4ED6\u4EBA\u5408\u6CD5\u6743\u76CA\u7684\uFF1B\r\n    <br>\r\n    9) \u542B\u6709\u6CD5\u5F8B\u3001\u884C\u653F\u6CD5\u89C4\u7981\u6B62\u7684\u5176\u4ED6\u5185\u5BB9\u7684\uFF1B\r\n    <br>\r\n    10) \u4FB5\u72AF\u4EFB\u4F55\u7B2C\u4E09\u8005\u7684\u77E5\u8BC6\u4EA7\u6743\uFF0C\u7248\u6743\u6216\u516C\u4F17/\u79C1\u4EBA\u6743\u5229\u7684\uFF1B\r\n    <br>\r\n    11) \u8FDD\u53CD\u4EBA\u6587\u9053\u5FB7\u3001\u98CE\u4FD7\u4E60\u60EF\u7684\uFF1B\r\n    <br>\r\n    12) \u4EFB\u4F55\u5F62\u5F0F\u7684\u672A\u7ECFAG\u86CB\u86CB\u8FD0\u8425\u56E2\u961F\u5141\u8BB8\u7684\u5E7F\u544A\uFF1B\r\n    <br>\r\n    13) \u4EFB\u4F55\u5F62\u5F0F\u7684\u635F\u5BB3AG\u86CB\u86CB\u5F62\u8C61\uFF0C\u8D28\u7591AG\u86CB\u86CB\u516C\u5E73\u6027\u7684\u8D1F\u9762\u8A00\u8BBA\u3002\r\n    <br>\r\n    6. \u7528\u6237\u7684\u6635\u79F0\u3001\u4E2A\u4EBA\u8D44\u6599\uFF0C\u4EE5\u53CA\u4E0E\u5B98\u65B9\u4EA7\u54C1\u76F8\u5173\u7684\u4EFB\u4F55\u53EF\u53D1\u5E03\u5185\u5BB9\u4E0D\u5F97\u5305\u542B\u672C\u89C4\u5219\u7B2C\u56DB\u6761\u7B2C5\u6B3E\u6240\u7981\u6B62\u53D1\u5E03\u7684\u5185\u5BB9\u3002\r\n    <br>\r\n    <b>\u516D\u3001\u670D\u52A1\u4E2D\u65AD\u3001\u505C\u6B62\u548C\u53D8\u66F4\u7684\u8BF4\u660E</b>\r\n    <br>\r\n    \u53D1\u751F\u4E0B\u5217\u60C5\u5F62\u4E4B\u4E00\u65F6\uFF0C\u5B98\u65B9\u6709\u6743\u4E2D\u65AD\u3001\u505C\u6B62\u6216\u53D8\u66F4\u5176\u6240\u63D0\u4F9B\u7684\u670D\u52A1\uFF0C\u5BF9\u4E8E\u56E0\u6B64\u800C\u4EA7\u751F\u7684\u56F0\u6270\u3001\u4E0D\u4FBF\u6216\u635F\u5931\uFF0C\u5B98\u65B9\u4E0D\u627F\u62C5\u4EFB\u4F55\u8D23\u4EFB\uFF1A\r\n    <br>\r\n    1.\u5B9A\u671F\u68C0\u67E5\u6216\u65BD\u5DE5\uFF0C\u8F6F\u786C\u4EF6\u66F4\u65B0\u7B49\uFF0C\u5373\u6682\u505C\u670D\u52A1\uFF0C\u5B98\u65B9\u5C06\u5C3D\u5FEB\u5B8C\u6210\u7EF4\u4FEE\u3001\u7EF4\u62A4\u5DE5\u4F5C\u3002\r\n    <br>\r\n    2.\u670D\u52A1\u5668\u906D\u5230\u4EFB\u4F55\u5F62\u5F0F\u7684\u7834\u574F\uFF0C\u65E0\u6CD5\u6B63\u5E38\u8FD0\u4F5C\u3002\r\n    <br>\r\n    3.\u7F51\u7EDC\u7EBF\u8DEF\u6216\u5176\u5B83\u5BFC\u81F4\u7528\u6237\u901A\u8FC7Internet\u8FDE\u63A5\u81F3\u670D\u52A1\u5668\u7684\u52A8\u4F5C\u53D1\u751F\u6EDE\u788D\u7B49\u60C5\u5F62\u3002\r\n    <br>\r\n    4.\u81EA\u7136\u707E\u5BB3\u7B49\u4E0D\u53EF\u6297\u529B\u7684\u56E0\u7D20\u3002\r\n    <br>\r\n    5.\u5728\u7D27\u6025\u60C5\u51B5\u4E4B\u4E0B\u4E3A\u7EF4\u62A4\u56FD\u5BB6\u5B89\u5168\u6216\u5176\u5B83\u4F1A\u5458\u53CA\u7B2C\u4E09\u8005\u4EBA\u8EAB\u5B89\u5168\u65F6\u3002\r\n    <br>\r\n    6.\u53D1\u751F\u7A81\u53D1\u6027\u8F6F\u786C\u4EF6\u8BBE\u5907\u4E0E\u7535\u5B50\u901A\u4FE1\u8BBE\u5907\u6545\u969C\u65F6\u3002\r\n    <br>\r\n    7.\u53D7\u56FD\u5BB6\u91CD\u5927\u4E8B\u4EF6\u5F71\u54CD\uFF0C\u6216\u8005\u4E92\u8054\u7F51\u884C\u4E1A\u89C4\u5219\u5168\u56FD\u6027\u8FDB\u884C\u8C03\u6574\u65F6\u3002\r\n    <br>\r\n    <b>\u4E03\u3001AG\u86CB\u86CB\u7528\u6237\u89C4\u5219\u7684\u89E3\u91CA\u3001\u66F4\u6539\u548C\u6DFB\u52A0</b>\r\n    <br>\r\n    \u672C\u89C4\u5219\u7684\u89E3\u91CA\u3001\u6548\u529B\u53CA\u9002\u7528\u4EE5\u4E2D\u534E\u4EBA\u6C11\u5171\u548C\u56FD\u6CD5\u5F8B\u4E3A\u4F9D\u636E\u3002\u5982\u679C\u672C\u534F\u8BAE\u7684\u4EFB\u4F55\u5185\u5BB9\u4E0E\u6CD5\u5F8B\u76F8\u62B5\u89E6\uFF0C\u5E94\u4EE5\u6CD5\u5F8B\u89C4\u5B9A\u4E3A\u51C6\u3002\u6B64\u524D\u63D0\u4E0B\uFF0CAG\u86CB\u86CB\u5B98\u65B9\u4FDD\u7559\u5BF9\u6B64\u89C4\u5219\u7684\u89E3\u91CA\u3001\u66F4\u6539\u548C\u6DFB\u52A0\u7684\u6743\u5229\u3002\r\n  </p>\r\n</div>');
